css:
@-moz-document domain("leetcode.com") {
body {
    background-color: #222;
    color: #DDD;
}
h2 {
	color: #a2a6c4;
}
code {
    background-color: #222;
    color: #989be2
}
.topic .vote-buttons {
	background-color: #222;
}

.navbar-default {
	background-color: #222;
}
a {
	color: #7b88ed;
}
.category>ul>li:not(.unread) h2 a {
	color: #b2b3ba;
}
.btn-group>.btn:first-child {
	color: #222;
}
.table-striped>tbody>tr:nth-of-type(odd) {
	background-color: #2f2f2f;
}
.ace_editor {
	font: 16px/normal 'Menlo', 'Monaco', 'Ubuntu Mono', 'Consolas', 'source-code-pro', monospace;
}
#status {
	background-color: #232020;
}
.form-control {
	color: #fdfdfd;
    background-color: #2d2e2f;
}
.iubenda-white {
	background: #c5c5c5;
}
.jumbotron {
	background-color: #272525;
}
.ace-tm {
	background-color: #bbbbbb;
    color: #1b1a1a;
}
.ace-tm .ace_gutter {
	background: #bbbbbb;
    color: #1b1a1a;
}
}
